import React from 'react'
import { ThemeProvider } from 'styled-components'
import { lightTheme } from './Themes'

const MySkillsPage = () => {
  return (
    <ThemeProvider theme={lightTheme}>
    <Main>
        MySkillsPage Component/Page
    </Main>
    </ThemeProvider>
  )
}

export default MySkillsPage
